import React from 'react';

function HeaderMenuItem(item) {
    return (
        <li>
            <button>{item.name}</button>
            <div>
            {
                item.buttons.map((button) =>
                    <button onClick={button.onClickFunction()}>button.name</button>
                )
            }
            </div>
        </li>
    );
}

export default HeaderMenuItem;
